import './App.scss';
import Header from './components/Header';
import News from './components/News';
import Nav from './components/Nav';
import Products from './components/Products';

function App() {
  return (
    <div className="App">
      <Nav />
        <Header />
        <Products />
        <News />
        <Footer />

    </div>
  );
}

export default App;
